  <div id="wolluAppAggroText">
    직장인 하루 평균 담배로 월루하는 시간
    <br/>
    확인하러가기
  </div>
  <div id="wolluAppAggroSpace8"/>
  <img src={WolluAppAggroCardSelection2}/>
